import React, { Component } from 'react'
import { Container,  Divider, Icon, Button} from 'semantic-ui-react'
import Events from '../Sections/Events/Events';
import AddEvent from '../Sections/AddEvent/AddEvent';
import Comments from '../Sections/Comments/Comments';
import Statistics from '../Sections/Statistics/Statistics';

export default class StoryDetail extends Component {


  render() {
    return (
    <Container>
        <Divider style={{color:'white'}} horizontal color='white'> Events(3)</Divider>
        <Events/>
        <Statistics/>
        <Divider style={{color:'white'}} horizontal color='white'> Add? </Divider>
        <AddEvent/>
        <Button icon='cross' color='red'> Delete Story? </Button>
        <Divider  style={{color:'white'}} horizontal color='white'> Comments (24) </Divider>
        <Comments/>
    </Container>

    )
  }
}
